export const theme = {
  sleeperpurple: "#734EF7",
  sleeperblue1: "#5581f1",
  sleeperblue2: "#6B85F7",
  gray3: "#c4c4c4",
  white: "#fff",
  
  mainwhite1: "#FFF",
};

export type ThemeKeyTypes = keyof typeof theme;
